Having regard to the Treaty establishing the European Economic Community,
Having regard to Council Regulation (EEC) No 2777/75 of 29 October 1975 on the common organization of the market in poultrymeat (1), as last amended by Regulation (EEC) No 1235/89 (2), and in particular Article 9 (3) thereof,
Whereas Commission Regulation (EEC) No 2505/92 of 14 July 1992 amending Annexes I and II to Council Regulation (EEC) No 2658/87 on the tariff and statistical nomenclature and on the Common Customs Tariff (3) provides for a subheading for live fowls of  the species Gallus domesticus weighing not more than 185 grams;
Whereas Commission Regulation (EEC) No 3846/87 (4), as last amended by Regulation (EEC) No 3064/92 (5), establishes an agricultural product nomenclature for export refunds on the basis of the combined nomenclature; whereas the former nomenclature should  be brought into line with the abovementioned amendment;
